int getIndex(std::vector<unsigned int>& cities, int start, int end, unsigned int searchedValue, int lastMidPoint) {
    int midPoint = start + ((end-start) / 2);
    if (midPoint == lastMidPoint) {
        if (midPoint >= cities.size()) {
            return cities.size() - 1;
        }
        return midPoint;
    }
    if (searchedValue == cities[midPoint]) {
        return midPoint;
    } else if (searchedValue > cities[midPoint]) {
        return getIndex(cities, midPoint+1, end, searchedValue, midPoint);
    } else {
        return getIndex(cities, start, midPoint, searchedValue, midPoint);
    }
}

